import React from 'react';
import './recipe.css';

interface CityData {
  cityName: string;
  countryName: string;
  yearFounded: number;
  attractions: string[];
  images: string[];
}

const CityInfo: React.FC = () => {
  const cityData: CityData = {
    cityName: 'Вена',
    countryName: 'Австрия',
    yearFounded: 1955,
    attractions: ['Дворец Хофбург', 'Дворец Шёнбрунн', 'Бельведер'],
    images: ['data:image/jpeg;base64,', 
    'data:image/jpeg;base64,', 
    'data:image/jpeg;base64,'],
  };

  return (
    <div className="city-container">
      <h1 className="title">{cityData.cityName}</h1>
      <p className="info-paragraph">Страна: {cityData.countryName}</p>
      <p className="info-paragraph">Год основания: {cityData.yearFounded}</p>

      <h2>Достопримечательности:</h2>
      <ul className="attractions-list">
        {cityData.attractions.map((attraction, index) => (
          <li key={index}>{attraction}</li>
        ))}
      </ul>

      <h2>Фотографии:</h2>
      <div className="image-container">
        {cityData.images.map((image, index) => (
          <img key={index} src={image} alt={`Фотография ${index + 1}`} />
        ))}
      </div>
    </div>
  );
};

export default CityInfo;
